GOLIATH® SW102 Double Swing Gate Opener for Gates up to 12 ft Long
Our Price: $440.00

Features:
- Handles dual gate up to 12 ft long (two panels by 6 ft each);
- Operator is in strong aluminum housing; 
- Stroke of each operator is 12" (300 mm); 
- Opening up to 120°; 
- Manual release wit key; 
- Extremely quiet; 
- Stainless steel rod with dust wiper; 
- Mechanical parts lubricated with lithium grease against corrosion, oxidation and rust; 

